import React from "react";

function SignIn(props) {
  return (
    <div className="SignIn">
      <div className="SignInArea">
        <div>
          <button className="SignInLeave">X</button>
        </div>
        <input className="SignInUsername" placeholder="Username..."></input>
        <input className="SignInPassword" placeholder="Password..."></input>
        <div className="SignInButtons">
          <button
            onClick={() => {
              props.setOpenSignIn(false);
            }}
          >
            Sign In
          </button>
          <button>Sign Up</button>
        </div>
      </div>
    </div>
  );
}

export default SignIn;
